class RelatorioTxt(): 
    def salvar_dados(self):
        file = open("cliente.txt", "w")
        self.pdf = FPDF()
        self.pdf.add_page()
    
        self.nomeRel = self.nome_entry.get()
        self.foneRel = self.telefone_entry.get()
        self.ruaRel = self.rua_entry.get('1.0' ,'end-1c')
        self.prodRel = self.pedido_entry.get('1.0' ,'end-1c')
        self.obsRel = self.obs_entry.get('1.0' ,'end-1c')
        self.totalRel = self.valorTotal_entry.get()
        self.pagRel = self.pagamento_entry.get()
        
        file.write("===== PEDIDO DE ENTREGA =====")
        file.write("\n")
        file.write("\n")
        file.write(f"NOME: {self.nomeRel}\n")
        file.write(f"CONTATO: {self.foneRel}\n")
        file.write(f"ENDEREÇO: {self.ruaRel.strip()}\n")
        file.write(f"PEDIDO: {self.prodRel.strip()}\n")
        file.write(f"OBS: {self.obsRel.strip()}\n")
        file.write(f"VALOR TOTAL:R$ {self.totalRel}\n")
        file.write(f"PAGAMENTO: {self.pagRel}\n")
        file.close()
        self.file = open("cliente.txt","r")
        
        for text in self.file:
            self.pdf.set_font("Arial",size=12)
            self.pdf.multi_cell(w=0,h=12,txt=text, align="L")
        self.pdf.output("pedido.pdf")
        webbrowser.open('pedido.pdf',"rb")
       
    
class Funcs():
    def limpar_tela(self):
        self.codigo_entry.delete(0, END)
        self.nome_entry.delete(0, END)
        self.telefone_entry.delete(0, END)
        self.pedido_entry.delete(1.0, END)
        self.rua_entry.delete(1.0, END)
        self.valorTotal_entry.delete(0, END)
        self.obs_entry.delete(1.0, END)
        self.pagamento_entry.delete(0, END)
        
    def conectar_bd(self):
        self.conn = sqlite3.connect("cadastro.db")
        self.cursor = self.conn.cursor(); print("Conectando ao Banco de Dados")
    
    def desconectar_bd(self):
        self.conn.close(); print("Desconectando do Banco de Dados")
    
    def criarTabela(self):
        self.conectar_bd(); print("Conectando ao Banco de Dados")
        ###Criando Tabela 
        self.cursor.execute("CREATE TABLE IF NOT EXISTS clientes(cod INTEGER PRIMARY KEY,nome_clientes TEXT(100) NOT NULL,telefone TEXT(20),rua TEXT(150),pedido TEXT(200),valorTotal INTEGER(10), pagamento TEXT(15), obs TEXT(200))")
        self.conn.commit(); print("Banco de Dados Criado")
        self.desconectar_bd()
    
    def variaveis(self):
        self.codigo = self.codigo_entry.get()
        self.nome = self.nome_entry.get()
        self.telefone = self.telefone_entry.get()
        self.rua = self.rua_entry.get(1.0, END)
        self.pedido = self.pedido_entry.get(1.0, END)
        self.valorTotal = self.valorTotal_entry.get()
        self.pagamento = self.pagamento_entry.get()
        self.obs = self.obs_entry.get(1.0, END)

    def add_clientes(self):
        self.variaveis()
        if self.nome_entry.get() == "":
            msg = """Para cadastrar um novo cliente é nescessário \n
                que seja digitado ao menos um nome!!!"""
            messagebox.showinfo("Cadastro de clientes - Aviso!!!", msg)
        elif self.rua_entry.get('1.0','end-2c') == "":
            msg = """Cadastre um Endereço!!!"""
            messagebox.showinfo("Cadastro de clientes - Aviso!!!", msg)
        elif self.pedido_entry.get('1.0','end-2c') == "":
            msg = """Cadastre um pedido!!!"""
            messagebox.showinfo("Cadastro de clientes - Aviso!!!", msg)
        else:
            self.conectar_bd()

            self.cursor.execute(""" INSERT INTO clientes (nome_clientes,telefone,rua,pedido,valorTotal,pagamento,obs)
                VALUES(?,?,?,?,?,?,?)""",(self.nome,self.telefone,self.rua,self.pedido,self.valorTotal, self.pagamento, self.obs))
        
            self.conn.commit()
            self.desconectar_bd()
            self.select_lista()
            self.limpar_tela()
            
    def select_lista(self):
        self.listaCli.delete(*self.listaCli.get_children())
        self.conectar_bd()
        lista = self.cursor.execute("""SELECT cod,nome_clientes,telefone,rua,pedido,valorTotal,pagamento,obs FROM clientes
            ORDER BY nome_clientes ASC; """)
        for i in lista:
            self.listaCli.insert("", END, values=i)
    
    def duplo_click(self, event):
        self.limpar_tela()
        self.listaCli.selection()

        for n in self.listaCli.selection():
            col1,col2,col3,col4,col5,col6,col7,col8 = self.listaCli.item(n, "values")
            self.codigo_entry.insert(END, col1)
            self.nome_entry.insert(END, col2)
            self.telefone_entry.insert(END, col3)
            self.rua_entry.insert(END, col4)
            self.pedido_entry.insert(END, col5)
            self.valorTotal_entry.insert(END,col6)
            self.pagamento_entry.insert(END, col7)
            self.obs_entry.insert(END, col8)

    def deleta_cliente(self):
        self.variaveis()
        self.conectar_bd()
        self.cursor.execute("""DELETE FROM clientes WHERE cod = ?""", [self.codigo])
        self.conn.commit()
        self.desconectar_bd()
        self.limpar_tela()
        self.select_lista()

    def altera_cliente(self):
        self.variaveis()
        self.conectar_bd()
        self.cursor.execute("""UPDATE clientes SET nome_clientes =?,telefone=?,rua=?,pedido=?,valorTotal=?,pagamento=?,obs=?
            WHERE cod = ? """, (self.nome, self.telefone, self.rua, self.pedido,self.valorTotal, self.pagamento, self.obs, self.codigo,))
        self.conn.commit()
        self.desconectar_bd()
        self.select_lista()
        self.limpar_tela()

    def buscar_cliente(self):
        self.conectar_bd()
        self.listaCli.delete(*self.listaCli.get_children())

        self.nome_entry.insert(END, '%')
        nome = self.nome_entry.get()
        self.cursor.execute(""" SELECT * FROM clientes WHERE nome_clientes LIKE '%s'"""% nome)
        buscanomeCli = self.cursor.fetchall()
        for i in buscanomeCli:
            self.listaCli.insert("", END, values=i)
        self.limpar_tela()
        self.desconectar_bd()
    
    def limpar_busca(self):
        self.conectar_bd()
        self.listaCli.delete(*self.listaCli.get_children())
        query = "SELECT * FROM clientes"
        self.cursor.execute(query)
        buscanomeCli = self.cursor.fetchall()
        for i in buscanomeCli:
            self.listaCli.insert("", END, values=i)
        self.limpar_tela()
        self.desconectar_bd()

